import React from "react";
import { ThemeProvider } from "@mui/material";

function App() {
  return (
    <ThemeProvider theme={'dark'}>

    <div className="App">
      <h1>Hello, world!</h1>
      <h2>Let's create a dark mode toggle that persists when the page is reloaded.</h2>
    </div>

    </ThemeProvider>
  );
}

export default App;
